// src/components/Footer.js
import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTwitter, faLinkedinIn, faRedditAlien } from '@fortawesome/free-brands-svg-icons';
import {
  TwitterShareButton,
  LinkedinShareButton,
  RedditShareButton,
} from 'react-share';
import './Footer.css'; // Ensure you have this CSS file or remove if not needed

const Footer = () => {
  const url = 'https://secondnetwork.ai/';
  const title = 'Build your own PayPal Mafia:';

  return (
    <footer className="footer-container flex-col bg-gray-800 text-white py-6">
      {/* Social Share Buttons */}
      <div className="center-section mb-4">
        <div className="share-buttons flex space-x-4 justify-center">
          <TwitterShareButton
            url={url}
            title={title}
            className="transition-transform ease-in-out transform hover:scale-125"
          >
            <FontAwesomeIcon icon={faTwitter} size="2x" className="icon-grey-transparent" />
          </TwitterShareButton>
          <LinkedinShareButton
            url={url}
            title={title}
            className="transition-transform ease-in-out transform hover:scale-125"
          >
            <FontAwesomeIcon icon={faLinkedinIn} size="2x" className="icon-grey-transparent" />
          </LinkedinShareButton>
          <RedditShareButton
            url={url}
            title={title}
            className="transition-transform ease-in-out transform hover:scale-125"
          >
            <FontAwesomeIcon icon={faRedditAlien} size="2x" className="icon-grey-transparent" />
          </RedditShareButton>
        </div>
      </div>

      {/* Footer Links */}
      <div className="flex space-x-5 flex-row justify-center mb-4 opacity-75">
        <a href="/privacy" className="hover:underline">Privacy</a>
        <a href="/terms" className="hover:underline">Terms</a>
        <a href="https://docs.google.com/forms/d/e/1FAIpQLSeTR_44kRLy9x1NzsyeddyqN1njmu7Z35xMLaI0r0CpLbtGBw/viewform" target="_blank" rel="noopener noreferrer" className="hover:underline">
          Feedback
        </a>
        <a href="https://www.gaborhollbeck.com" target="_blank" rel="noopener noreferrer" className="hover:underline">
          Gabor Hollbeck
        </a>
        <a href="https://x.com/gaborhollbeck" target="_blank" rel="noopener noreferrer" className="hover:underline">
          @gaborhollbeck
        </a>
        <a href="mailto:ghollbeck@ethz.ch" className="hover:underline">ghollbeck@ethz.ch</a>
      </div>
    </footer>
  );
};

export default Footer;
